Teenage Mutant Ninja Turtles #1 [IDW]

This first Teenage Mutant Ninja Turtles series will feature new and exciting storylines that maintain the turtle power core beloved by millions of fans. Leonardo, Donatello, Michelangelo, and Raphael reunite to bring their ninja aptitude and teenage attitude in these all-new, action-packed adventures based on the original series. The first story arc will tell the origin story of the Turtles and introduce a new villain, the fearsome mutant alley cat, Old Hob. Featuring a cast of familiar characters, including Master Splinter, April ONeill, Casey Jones, and true to the spirit of the original comics created by Eastman and Peter Laird, the Teenage Mutant Ninja Turtles are bigger and badder than ever, and ready to rock old and new fans alike.


